'use strict';

/**
* Cauchy distribution logarithm of probability density function (PDF).
*
* @module @stdlib/math/base/dist/cauchy/logpdf
*
* @example
* var logpdf = require( '@stdlib/math/base/dist/cauchy/logpdf' );
*
* var y = logpdf( 2.0, 0.0, 1.0 );
* // returns ~-2.765
*
* var myPDF = logpdf.factory( 10.0, 2.0 );
* y = myPDF( 10.0 );
* // returns ~-1.839
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var logpdf = require( './logpdf.js' );
var factory = require( './factory.js' );


// MAIN //

setReadOnly( logpdf, 'factory', factory );


// EXPORTS //

module.exports = logpdf;
